info:
  contact: {email: frikky@shuffler.io, name: '@frikkylikeme', url: 'https://twitter.com/frikkylikeme'}
  description: Automated generation of Group-IB Intelligence API
  title: Group-IB Intelligence API
  version: 1.0.0
  x-logo: data:image/png;base64,
openapi: 3.0.2
paths:
  tmp0:
    post:
      description: Get Advertisement Information from Group-IB Intelligence API
      parameters:
      - description: Limit of results to return
        example: '100'
        in: body
        name: Limit
        required: false
        schema: {type: string}
      - description: How many records to start grabbing from
        example: '20'
        in: body
        name: Start Index
        required: false
        schema: {type: string}
      responses:
        '200':
          content:
            application/json:
              schema: {$ref: '#/components/schemas/tmp0'}
          description: Successful request
      summary: Group-IB Get Advertisement Info
